        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "Вариабельность сердечного ритма, также известная как ВСР, представляет собой изменение времени между каждым сердечным сокращением. Так что, в то время как ваш пульс измеряет, сколько раз ваше сердце бьется в минуту, ВСР - это изменение времени между этими сокращениями."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "Ваша вариабельность сердечного ритма - важный показатель того, насколько хорошо вы можете справляться и восстанавливаться от стресса, будь то физический стрессор (такой как упражнения или болезнь) или эмоциональный и ментальный стрессор (как тревога). Увеличение вариабельности сердечного ритма означает лучший сон, уменьшение боли и улучшение общего здоровья и фитнеса."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "Ваша индивидуальная вариабельность сердечного ритма представлена вашим показателем ВРИ. Обычно ВРИ измеряется в миллисекундах, и более высокий показатель ВРИ указывает на лучшее здоровье."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Чтобы понять, почему высокий показатель ВРИ указывает на хорошее здоровье, вы должны знать, что вариабельность сердечного ритма контролируется вегетативной нервной системой (или ВНС). Вегетативная нервная система регулирует непроизвольные функции организма (такие как пищеварение, артериальное давление, дыхание и сердечный ритм) и состоит из двух ветвей - симпатической нервной системы (\"режим борьбы или бегства\") и парасимпатической нервной системы (\"режим отдыха, пищеварения и восстановления\")."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "Симпатическая нервная система, общеизвестная как режим \"борьбы или бегства\", активируется непроизвольно, когда ваш организм воспринимает угрозу. Чтобы защитить себя, организм использует симпатическую нервную систему для ускорения дыхания, увеличения артериального давления и повышения уровня стрессгормонов, таких как кортизол, чтобы убедиться, что у вас есть вся энергия и ресурсы, необходимые для безопасности в опасной ситуации."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "Парасимпатическая нервная система, также известная как режим \"покоя и пищеварения\", представляет собой состояние расслабления. Она снижает ваш пульс, замедляет дыхание и позволяет вашему организму вернуться к гомеостазу (естественному балансу). Когда вы находитесь в парасимпатическом состоянии, ваш организм чувствует себя в безопасности, перераспределяя кровоток и энергию для восстановительных функций, таких как сон, пищеварение и размножение."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Поэтому высокая вариация времени между вашими сердечными сокращениями, также известная как высокий показатель HRV, означает, что ваша автономная нервная система способна эффективно реагировать, включая симпатическую нервную систему, чтобы справляться со стрессовыми ситуациями, а затем переходить в расслабленное состояние парасимпатической системы, когда угроза миновала."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Оценка интенсивности и восстановления: Следя за HRV, люди могут получить более точное представление о своих уровнях физической усталости и состоянии восстановления. Более низкий уровень HRV может указывать на перетренировку или недостаточное восстановление, подталкивая к корректировке плана тренировок, такой как увеличение периодов отдыха или переход к упражнениям с низкой интенсивностью, чтобы избежать чрезмерной нагрузки."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Психологический стресс и физическая производительность: Продолжительный психологический стресс может привести к снижению HRV, влияя на атлетическую производительность. Таким образом, поддержание хорошей HRV способствует оптимальному психологическому и физиологическому состоянию, тем самым улучшая конкурентоспособность."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "В заключение, вариабельность сердечного ритма играет ключевую роль в направлении индивидуальных программ упражнений, мониторинге общего состояния здоровья и прогнозировании спортивной эффективности. Следя и анализируя изменения в HRV, люди могут принимать обоснованные и научные решения относительно своей фитнес-программы."),
